<!doctype html>
<html lang="ms">
<head>
<meta charset="utf-8"/>
<meta name="viewport" content="width=device-width,initial-scale=1"/>
<title>Tempahan STS 100 Tahun – Pakej B</title>
<style>
:root{
  --bg:#f8fbff;--card:#fff;--accent:#4a90e2;--accent-dark:#2b6cb0;--muted:#263238;
}
*{box-sizing:border-box}
body{margin:0;font-family:Inter,Roboto,"Segoe UI",Arial,sans-serif;background:var(--bg);color:var(--muted);padding:14px}
.container{max-width:1200px;margin:0 auto}
.header{display:flex;align-items:center;gap:12px;margin-bottom:10px}
.logo{height:90px;width:auto;border-radius:6px}
h1{margin:0;font-size:20px;color:var(--accent-dark)}
.small{font-size:13px;color:#6b7280}
.top-row{display:flex;gap:12px;align-items:flex-start;margin-bottom:12px}
.form-card,.user-info{background:var(--card);padding:12px;border-radius:10px;box-shadow:0 8px 20px rgba(2,6,23,0.04);min-width:280px}
.khemah-grid{display:grid;grid-template-columns:repeat(5,1fr);gap:14px}
.khemah{background:var(--card);border-radius:10px;padding:10px;min-height:260px;border:2px solid rgba(74,144,226,0.06);position:relative}
.khemah h3{margin:0 0 8px 0;font-size:16px}
.tables{display:grid;grid-template-columns:repeat(2,1fr);gap:10px;justify-items:center;padding:6px}
.table-set{width:150px;height:150px;position:relative}
.table-center{position:absolute;width:70px;height:70px;left:50%;top:50%;transform:translate(-50%,-50%);border-radius:50%;background:var(--card);border:3px solid rgba(74,144,226,0.06);display:flex;align-items:center;justify-content:center;font-weight:700}
.table-label{position:absolute;left:50%;transform:translateX(-50%);top:6px;font-weight:700;color:#222}
.seat{position:absolute;width:34px;height:34px;border-radius:50%;background:var(--card);border:2px solid rgba(74,144,226,0.12);display:flex;align-items:center;justify-content:center;font-size:15px;cursor:pointer;box-shadow:0 6px 18px rgba(16,24,40,0.04);transition:transform .12s}
.seat:hover{transform:scale(1.06);background:rgba(74,144,226,0.06)}
.seat.booked{background:linear-gradient(180deg,#22c55e,#10b981);color:#fff;cursor:not-allowed}
.seat.selected{background:linear-gradient(180deg,#c3ddff,#93c5fd)}
.bookings-area{margin-top:12px;background:var(--card);border-radius:10px;padding:10px;box-shadow:0 8px 18px rgba(2,6,23,0.04)}
.admin-gear{position:fixed;top:14px;right:14px;background:#fff;border-radius:50%;width:44px;height:44px;display:flex;align-items:center;justify-content:center;box-shadow:0 8px 22px rgba(0,0,0,0.08);cursor:pointer;z-index:99999;font-size:20px}
#adminPanel{position:fixed;top:64px;right:14px;background:#fff;padding:12px;border-radius:8px;box-shadow:0 8px 20px rgba(2,6,23,0.06);display:none;z-index:99998;width:320px}
.selection-bar{position:fixed;right:16px;bottom:16px;background:var(--card);padding:8px;border-radius:10px;box-shadow:0 10px 30px rgba(0,0,0,0.08);display:flex;gap:8px;align-items:center;z-index:9000}
.modal{display:none;position:fixed;inset:0;background:rgba(0,0,0,0.45);align-items:center;justify-content:center;z-index:100000}
.modal .box{background:var(--card);padding:16px;border-radius:10px;width:520px;max-width:96%}
@media(max-width:1100px){.khemah-grid{grid-template-columns:repeat(2,1fr)}.top-row{flex-direction:column}}
@media(max-width:520px){.khemah-grid{grid-template-columns:repeat(1,1fr)}.logo{height:72px}}
.btn{padding:8px 12px;border-radius:8px;cursor:pointer;border:none;font-weight:600}
.btn-primary{background:var(--accent-dark);color:#fff}
.btn-ghost{background:#fff;color:var(--accent-dark);border:1px solid rgba(74,144,226,0.12)}
.note{font-size:12px;color:#6b7280}
</style>
</head>

<!-- Tempahan_STS100B.html — PART 2/2 -->
<script>
const VALID_RESITS = Array.from({length:160},(_,i)=>`STS100B${String(i+1).padStart(3,'0')}`);
const KHEMAH_ORDER = ['K','L','M','N','O'];
const TABLES_PER_KHEMAH = 4;
const SEATS_PER_TABLE = 8;
const STORAGE_KEY = 'sts100b_bookings';
const USER_KEY = 'sts100b_user';
const LAST_RECEIPT_KEY = 'sts100b_last_receipt';
const ADMIN_PW = 'STSADMIN2025';
const MAX_PER_RESIT = 8;

let bookings = JSON.parse(localStorage.getItem(STORAGE_KEY) || '{}');
let currentUser = JSON.parse(localStorage.getItem(USER_KEY) || 'null');
let selectedSeats = [];

function saveAll(){ localStorage.setItem(STORAGE_KEY, JSON.stringify(bookings)); }
function openModal(title,msg){
  document.getElementById('modalTitle').textContent=title;
  document.getElementById('modalMsg').innerHTML=msg;
  document.getElementById('modal').style.display='flex';
}
document.getElementById('closeModal').onclick=()=>document.getElementById('modal').style.display='none';
function escapeHtml(s){return String(s||'').replace(/[&<>"']/g,m=>({'&':'&amp;','<':'&lt;','>':'&gt;','"':'&quot;',"'":'&#39;'}[m]));}

/* ----------- GRID ----------- */
function buildGrid(){
  const grid=document.getElementById('khemahGrid');
  grid.innerHTML='';
  KHEMAH_ORDER.forEach(k=>{
    const card=document.createElement('div');card.className='khemah';
    const header=document.createElement('h3');header.textContent=`Khemah ${k}`;card.appendChild(header);
    const tables=document.createElement('div');tables.className='tables';
    for(let t=1;t<=TABLES_PER_KHEMAH;t++){
      const set=document.createElement('div');set.className='table-set';
      const center=document.createElement('div');center.className='table-center';center.textContent='M'+t;set.appendChild(center);
      for(let s=0;s<SEATS_PER_TABLE;s++){
        const seat=document.createElement('div');seat.className='seat';
        const angle=(s/SEATS_PER_TABLE)*2*Math.PI - Math.PI/2;
        const r=44;
        seat.style.left=(50+Math.cos(angle)*r*0.8)+'%';
        seat.style.top=(50+Math.sin(angle)*r*0.8)+'%';
        const seatId=`${k}-T${t}-S${s+1}`;
        seat.dataset.id=seatId;
        if(bookings[seatId])seat.classList.add('booked');
        seat.textContent=s+1;
        seat.addEventListener('click',()=>onSeatClick(seat));
        set.appendChild(seat);
      }
      tables.appendChild(set);
    }
    card.appendChild(tables);
    grid.appendChild(card);
  });
  refreshBookingsList();
}

/* ----------- SEAT CLICK ----------- */
function onSeatClick(el){
  const id=el.dataset.id;
  if(bookings[id]){openModal('Maaf','Kerusi telah ditempah.');return;}
  if(!currentUser){openModal('Pendaftaran Diperlukan','Sila daftar dahulu.');return;}
  if(selectedSeats.includes(id)){selectedSeats=selectedSeats.filter(x=>x!==id);el.classList.remove('selected');}
  else{
    const owned=Object.values(bookings).filter(b=>b.receipt===currentUser.receipt).length;
    if(owned+selectedSeats.length+1>MAX_PER_RESIT){openModal('Had Mencapai','Setiap resit dibenarkan maksimum '+MAX_PER_RESIT+' kerusi.');return;}
    selectedSeats.push(id);el.classList.add('selected');
  }
  document.getElementById('selectionBar').style.display=selectedSeats.length?'flex':'none';
  document.getElementById('selInfo').textContent=selectedSeats.length+' kerusi dipilih';
}

/* ----------- REGISTRATION ----------- */
document.getElementById('saveReg').addEventListener('click',()=>{
  const name=document.getElementById('name').value.trim();
  const phone=document.getElementById('phone').value.trim();
  const batch=document.getElementById('batch').value.trim();
  const receipt=document.getElementById('receipt').value.trim().toUpperCase();
  const err=document.getElementById('formErr');err.style.display='none';
  if(!name||!phone||!batch||!receipt){err.style.display='block';err.textContent='Semua medan wajib diisi.';return;}
  if(!VALID_RESITS.includes(receipt)){err.style.display='block';err.textContent='No. resit tidak sah (STS100B001–STS100B160).';return;}
  if(Object.values(bookings).some(b=>b.receipt===receipt)){err.style.display='block';err.textContent='Resit ini telah digunakan.';return;}
  currentUser={name,phone,batch,receipt};
  localStorage.setItem(USER_KEY,JSON.stringify(currentUser));
  openModal('Berjaya','Pendaftaran berjaya. Anda boleh pilih kerusi.');
  document.getElementById('formCard').style.display='none';
  document.getElementById('userInfo').style.display='block';
  document.getElementById('infoList').innerHTML=`<div>👤 ${escapeHtml(name)}</div><div>📞 ${escapeHtml(phone)}</div><div>🎓 ${escapeHtml(batch)}</div><div>🧾 ${escapeHtml(receipt)}</div>`;
  buildGrid();
});

/* ----------- EDIT ----------- */
document.getElementById('editReg').addEventListener('click',()=>{
  currentUser=null;localStorage.removeItem(USER_KEY);
  document.getElementById('userInfo').style.display='none';
  document.getElementById('formCard').style.display='block';
});

/* ----------- CONFIRM ----------- */
document.getElementById('confirmBtn').addEventListener('click',()=>{
  if(!currentUser||selectedSeats.length===0)return;
  const conflicts=selectedSeats.filter(id=>bookings[id]);
  if(conflicts.length){openModal('Konflik','Kerusi telah diambil: '+conflicts.join(', '));selectedSeats=[];buildGrid();return;}
  selectedSeats.forEach(id=>{bookings[id]={seat:id,...currentUser,time:new Date().toLocaleString()};});
  saveAll();
  localStorage.setItem(LAST_RECEIPT_KEY,currentUser.receipt);
  exportCSV(bookings);
  openModal('Selesai','Tempahan disimpan dan CSV dimuat turun.');
  currentUser=null;localStorage.removeItem(USER_KEY);
  document.getElementById('formCard').style.display='block';
  document.getElementById('userInfo').style.display='none';
  selectedSeats=[];document.getElementById('selectionBar').style.display='none';
  document.querySelectorAll('#formCard input').forEach(i=>i.value='');
  buildGrid();
});

/* ----------- CANCEL ----------- */
document.getElementById('cancelSel').addEventListener('click',()=>{
  document.querySelectorAll('.seat.selected').forEach(s=>s.classList.remove('selected'));
  selectedSeats=[];document.getElementById('selectionBar').style.display='none';
});

/* ----------- CSV ----------- */
function exportCSV(dataObj){
  const rows=[['Seat','Nama','Telefon','Batch','Resit','Masa']];
  Object.keys(dataObj).forEach(k=>{
    const b=dataObj[k];
    rows.push([b.seat,b.name,b.phone,b.batch,b.receipt,b.time].map(v=>`"${String(v).replace(/"/g,'""')}"`).join(','));
  });
  const csv=rows.join('\n');
  const blob=new Blob([csv],{type:'text/csv;charset=utf-8;'});
  const url=URL.createObjectURL(blob);
  const a=document.createElement('a');a.href=url;a.download='Tempahan_STS100B.csv';a.click();URL.revokeObjectURL(url);
}
document.getElementById('exportCsvBtn').addEventListener('click',()=>exportCSV(bookings));

/* ----------- PADAM SENDIRI ----------- */
document.getElementById('clearMyBtn').addEventListener('click',()=>{
  const last=localStorage.getItem(LAST_RECEIPT_KEY)||(currentUser&&currentUser.receipt);
  if(!last){openModal('Tiada','Tiada resit ditemui.');return;}
  if(!confirm('Padam semua tempahan bagi resit '+last+'?'))return;
  let removed=0;
  Object.keys(bookings).forEach(k=>{if(bookings[k].receipt===last){delete bookings[k];removed++;}});
  saveAll();buildGrid();refreshBookingsList();
  openModal('Selesai',removed+' entri dipadam.');
});

/* ----------- ADMIN ----------- */
document.getElementById('adminGear').onclick=()=>{
  const p=document.getElementById('adminPanel');
  p.style.display=p.style.display==='block'?'none':'block';
};
document.getElementById('adminDelete').onclick=()=>{
  const pw=document.getElementById('adminPw').value;
  if(pw!==ADMIN_PW){alert('Kata laluan salah');return;}
  if(!confirm('Padam semua tempahan?'))return;
  bookings={};saveAll();buildGrid();refreshBookingsList();
  alert('Semua tempahan dipadam.');
};
document.getElementById('adminExport').onclick=()=>{
  const pw=document.getElementById('adminPw').value;
  if(pw!==ADMIN_PW){alert('Kata laluan salah');return;}
  exportCSV(bookings);
};

/* ----------- BOOKING LIST ----------- */
function refreshBookingsList(){
  const el=document.getElementById('bookingsList');
  const arr=Object.values(bookings);
  if(!arr.length){el.innerHTML='<div class="note">Tiada tempahan.</div>';return;}
  el.innerHTML=arr.map(b=>`${escapeHtml(b.seat)} — ${escapeHtml(b.name)} (${escapeHtml(b.receipt)})`).join('<br>');
}

/* ----------- INIT ----------- */
buildGrid();refreshBookingsList();
</script>
</body>
</html>
